import AsyncStorage from "@react-native-async-storage/async-storage";
import React from "react";
import {
  View,
  Text,
  SafeAreaView,
  Keyboard,
  ScrollView,
  Alert,
} from "react-native";

import COLORS from "../components/Colors";
import Button from "../components/Button";
import Input from "../components/Input";

import _Appbar from "../components/Appbar";
import Constants from 'expo-constants'

const RegistroHistoriaClinica = ({ navigation }) => {
  const [inputs, setInputs] = React.useState({
    nombre: "",
    apellido: "",
    dni: "",
    numHistoria: "",
    fechaNacimiento: "",
    sexo: "",
  });
  const [errors, setErrors] = React.useState({});
  const [loading, setLoading] = React.useState(false);

  const validate = () => {
    Keyboard.dismiss();
    let isValid = true;

    if (!inputs.nombre) {
      handleError("Ingresa tu nombre", "nombre");
      isValid = false;
    }

    if (!inputs.apellido) {
      handleError("Ingresa tu apellido", "apellido");
      isValid = false;
    }

    if (!inputs.dni) {
      handleError("Ingresa tu DNI.", "dni");
      isValid = false;
    } else if (inputs.dni.length != 8) {
      handleError("La longitud del DNI es 8", "dni");
      isValid = false;
    }

    if (!inputs.numHistoria) {
      handleError("Ingresa numero Historia Clinica", "numHistoria");
      isValid = false;
    } 
    if (!inputs.fechaNacimiento) {
      handleError("Ingresa fecha de Nacimiento", "fechaNacimiento");
      isValid = false;
    }

    if (!inputs.sexo) {
      handleError("Ingresa sexo del paciente", "sexo");
      isValid = false;
    } 

    if (isValid) {
      register();
    }

  };

  const register = () => {
    //setLoading(true);
    setTimeout(() => {
      try {
        setLoading(false);
        // Esto debe hacer la llamada al servicio
        AsyncStorage.setItem("registro", JSON.stringify(inputs));
        navigation.navigate("TerminosCondiciones");
      } catch (error) {
        Alert.alert("Error", "Something went wrong");
      }
    }, 10);
  };

  const handleOnchange = (text, input) => {
    setInputs((prevState) => ({ ...prevState, [input]: text }));
  };
  const handleError = (error, input) => {
    setErrors((prevState) => ({ ...prevState, [input]: error }));
  };
  return (
    <View style={{marginTop: Constants.statusBarHeight, flexGrow:1}}>
    <_Appbar {...navigation}/>
    <SafeAreaView style={{ backgroundColor: COLORS.white, flex: 1 }}>
      <ScrollView
        contentContainerStyle={{ paddingTop: 50, paddingHorizontal: 20 }}
      >
        <Text style={{ color: COLORS.black, fontSize: 40, fontWeight: "bold" }}>
          Registro de Historia Clinica
        </Text>
        <View style={{ marginVertical: 20 }}>
          <Input
            onChangeText={(text) => handleOnchange(text, "nombre")}
            onFocus={() => handleError(null, "nombre")}
            iconName="account-circle"
            label="Nombres"
            //placeholder="Ingresa tus nombres"
            error={errors.nombre}
          />

          <Input
            onChangeText={(text) => handleOnchange(text, "apellido")}
            onFocus={() => handleError(null, "apellido")}
            iconName="account-circle"
            label="Apellidos"
            //placeholder="Ingresa tus apellidos"
            error={errors.apellido}
          />

          <Input
            keyboardType="numeric"
            onChangeText={(text) => handleOnchange(text, "dni")}
            onFocus={() => handleError(null, "dni")}
            iconName="card-account-details-outline"
            label="DNI"
            //placeholder="Enter your phone no"
            error={errors.dni}
          />
          <Input
            onChangeText={(text) => handleOnchange(text, "numHistoria")}
            onFocus={() => handleError(null, "numHistoria")}
            iconName="note-text"
            label="NÃºmero de Historia Clinica"
            //placeholder="Enter your phone no"
            error={errors.numHistoria}
          />
          <Input
            onChangeText={(text) => handleOnchange(text, "fechaNacimiento")}
            onFocus={() => handleError(null, "fechaNacimiento")}
            iconName="calendar"
            label="Fecha de Nacimiento"
            //placeholder="Enter your phone no"
            error={errors.fechaNacimiento}
          />
          <Input
            onChangeText={(text) => handleOnchange(text, "sexo")}
            onFocus={() => handleError(null, "sexo")}
            iconName="gender-male"
            label="Sexo"
            //placeholder="Enter your password"
            error={errors.sexo}
          />
          <Button title="Registro" onPress={validate} />
        </View>
      </ScrollView>
    </SafeAreaView>
    </View>
  );
};

export default RegistroHistoriaClinica;
